		height: 100,
		backgroundColor: 'gray',
		margin: 50,
	}; // 배열은 성격이 같은 애들을 묶어둔 것, 객체는 성격이 다른 애들을 한 가지의 주제로 묶은 것

	return (
		<div className='wrap'>
			<article style={box}></article>
		</div>
	);
}

export default App;

